/* Mốc 1: MONTH_3 - 1000km (6 part) */
INSERT INTO maintenance_stage_detail
(maintenance_stage_detail_id, maintenance_stage_id, part_id, action_type, description, status, created_at, updated_at)
SELECT UUID(), ms.maintenance_stage_id, p.part_id, p.action_type, p.description, 'ACTIVE', NOW(), NOW()
FROM maintenance_stage ms
JOIN (
  SELECT 'f3a4b5c6-d7e8-4f9a-0b1c-2d3e4f5a6b7c' AS part_id, 'INSPECTION' AS action_type, 'Kiểm tra phanh trước' AS description
  UNION ALL SELECT '2a92ae32-30f6-4584-bf1e-8c3be11197c3', 'INSPECTION', 'Kiểm tra phanh sau'
  UNION ALL SELECT 'e2f1a4b5-6c7d-4e8f-9a0b-1c2d3e4f5a6b', 'INSPECTION', 'Kiểm tra mức dầu phanh'
  UNION ALL SELECT 'b864d469-e3a5-4894-86ff-aa41c173a6ef', 'INSPECTION', 'Kiểm tra lốp trước'
  UNION ALL SELECT 'e90a35ba-d498-44f9-b323-602ab48a6043', 'INSPECTION', 'Kiểm tra lốp sau'
  UNION ALL SELECT '9c2bf134-e3be-407e-9937-b85e36175afd', 'INSPECTION', 'Kiểm tra đèn chiếu sáng'
) p
WHERE ms.maintenance_plan_id = '0d13d861-d141-4382-acb9-6a8326b5cbce'
  AND ms.duration_month = 'MONTH_3'
  AND ms.mileage = 1000;

