-------- STAGE --------

INSERT INTO emotocare.vehicle_stage
(
    vehicle_stage_id,
    maintenance_stage_id,
    actual_maintenance_mileage,
    actual_maintenance_unit,
    vehicle_id,
    updated_at,
    status,
    actual_implementation_date,
    created_at,
    expected_end_date,
    expected_implementation_date,
    expected_start_date
)
SELECT
    UUID(),
    ms.maintenance_stage_id,
    0 AS actual_maintenance_mileage,
    'KILOMETER',
    v.vehicle_id,
    NOW(),
    CASE
        WHEN NOW() <
            DATE_SUB(
                DATE_ADD(
                    v.purchase_date,
                    INTERVAL CAST(SUBSTRING_INDEX(ms.duration_month, '_', -1) AS UNSIGNED) MONTH
                ),
                INTERVAL 10 DAY
            )
            THEN 'NO_START'
        WHEN NOW() BETWEEN
            DATE_SUB(
                DATE_ADD(
                    v.purchase_date,
                    INTERVAL CAST(SUBSTRING_INDEX(ms.duration_month, '_', -1) AS UNSIGNED) MONTH
                ),
                INTERVAL 10 DAY
            )
            AND
            DATE_ADD(
                DATE_ADD(
                    v.purchase_date,
                    INTERVAL CAST(SUBSTRING_INDEX(ms.duration_month, '_', -1) AS UNSIGNED) MONTH
                ),
                INTERVAL 10 DAY
            )
            THEN 'UPCOMING'
        ELSE 'EXPIRED'
    END,
    NULL,
    v.purchase_date,
    DATE_ADD(
        DATE_ADD(
            v.purchase_date,
            INTERVAL CAST(SUBSTRING_INDEX(ms.duration_month, '_', -1) AS UNSIGNED) MONTH
        ),
        INTERVAL 10 DAY
    ),
    DATE_ADD(
        v.purchase_date,
        INTERVAL CAST(SUBSTRING_INDEX(ms.duration_month, '_', -1) AS UNSIGNED) MONTH
    ),
    DATE_SUB(
        DATE_ADD(
            v.purchase_date,
            INTERVAL CAST(SUBSTRING_INDEX(ms.duration_month, '_', -1) AS UNSIGNED) MONTH
        ),
        INTERVAL 10 DAY
    )
FROM vehicle v
JOIN model m ON v.model_id = m.model_id
JOIN maintenance_plan mp ON m.maintenance_plan_id = mp.maintenance_plan_id
JOIN maintenance_stage ms ON ms.maintenance_plan_id = mp.maintenance_plan_id
WHERE NOT EXISTS (
    SELECT 1
    FROM vehicle_stage vs
    WHERE vs.vehicle_id = v.vehicle_id
      AND vs.maintenance_stage_id = ms.maintenance_stage_id
);

